// src/user/GuestLogin.js
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

function GuestLogin() {
  const navigate = useNavigate();
  const { login } = useAuth();

  const handleGuestLogin = async () => {
    try {
      const res = await fetch("http://localhost:3000/user/guest", {
        method: "POST",
      });
      const data = await res.json();
      if (res.ok) {
        login({ user_id: data.user_id, username: data.username }, data.token);
        navigate("/exercises");
      } else {
        alert(data.error);
      }
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div className="container mx-auto p-6">
      <h2 className="text-2xl font-bold mb-4">Guest Login</h2>
      <button onClick={handleGuestLogin} className="bg-green-600 text-white p-2 rounded">
        Login as Guest
      </button>
    </div>
  );
}

export default GuestLogin;
